import React,{Component, useState} from 'react';
import {Rnd} from 'react-rnd';
import axios from 'axios';
import TextList from './builder/TextList';
import g from 'react-scale-text';
import NavBar from './components/NavBar';
import Blocks from './blocks/blocks'
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ImageList from './builder/ImageList'
import SvgList from './builder/SvgList'
import PixabaySearch from './assets/Asset-Load';

import './App.css';

import MainMenu from './menu/MainMenu';

import './App.css';


function App() {
  return (
    <Router>
      <div className="App">
        <MainMenu />
        <div className="app-container">
          {/* Routes */}
          <Routes>
            <Route path="/save-load">
              {/* Render Save/Load component or content */}
              <h1>Save/Load Page</h1>
            </Route>
            <Route path="/components">
              {/* Render Components component or content */}
              <h1>Components Page</h1>
            </Route>
            <Route path="/assets">
              {/* Render PixabaySearch component */}
              <PixabaySearch />
            </Route>
            <Route path="/databases">
              {/* Render Databases component or content */}
              <h1>Databases Page</h1>
            </Route>
            <Route path="/graphics">
              {/* Render Graphics component or content */}
              <h1>Graphics Page</h1>
            </Route>
            <Route path="/analytics">
              {/* Render Analytics component or content */}
              <h1>Analytics Page</h1>
            </Route>
            <Route path="/sign-out">
              {/* Render Sign Out component or content */}
              <h1>Sign Out Page</h1>
            </Route>
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
